function FeesInfoListDataSource(){console.log(params);var t=new kendo.data.DataSource({transport:{read:{url:"/api/students/fees_info",dataType:"json"}},schema:{total:"total",data:"data",model:{id:"id",fields:{id:{type:"string",editable:!1}}}},batch:!0,pageSize:100,serverPaging:!1,serverFiltering:!1,serverSorting:!1});return t}function FeesInfoListGrid(){jQuery("#fees_info_List").kendoGrid({dataSource:FeesInfoListDataSource(),resizable:!0,pageable:{refresh:!0},scrollable:!1,sortable:!0,columns:[{field:"id",title:"Fee Type"},{command:[{name:"edit",text:"Edit",click:edit_systems},{name:"Delete",text:"Delete",click:delete_systems}]}]})}function edit_systems(t){var e=this.dataItem(jQuery(t.currentTarget).closest("tr"));openModal("fees_structures/"+e.id+"/edit","#feesstructureModal")}function delete_systems(t){var e=this.dataItem(jQuery(t.currentTarget).closest("tr"));doDelete("/api/fees_structures/"+e.id,e.id,"#fees_structure_List")}$(document).ready(function(){FeesInfoListGrid()});